import { Auth } from "aws-amplify";
import React, { useContext } from "react";
import { useEffect } from "react";
import { Route, Redirect, useHistory } from "react-router-dom";
import { Login, SignUp } from "..";
import { AuthStatusContext } from "../../utils/AuthState";
import Verification from "../Authentication/Verification/Verification";
import Home from "../Home/Home";

interface IPrivateRouteProps {
  component: React.ComponentType<any>;
  exact?: boolean;
  path: string;
}

const PrivateRoute = ({
  component: Component,
  ...rest
}: IPrivateRouteProps) => {
  const { loggedIn } = useContext(AuthStatusContext);
  const history = useHistory();

  /*useEffect(() => {
    if (!loggedIn) history.push("/");
  }, []);*/

  return (
    <Route
      {...rest}
      render={(props) => {
        return loggedIn ? (
          <Component {...props} /> === <Home /> ||
          <Component {...props} /> === <Login /> ||
          <Component {...props} /> === <SignUp /> ||
          <Component {...props} /> === <Verification /> ? (
            <Redirect
              to={{
                pathname: "/results",
              }}
            />
          ) : (
            <Component {...props} />
          )
        ) : (
          <Redirect
            to={{
              pathname: "/",
            }}
          />
        );
      }}
    />
  );
};

export default PrivateRoute;
